import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';

const Page1 = () => {
    return <div> Page1 </div>;
}

const Page2 = () => {
    return <div> Page2 </div>;
}

const App = () => {
    return (
        <div>
            <BrowserRouter>
                <div>
                    <Route path='/' exact component={Page1} />
                    <Route path='/page2' component={Page2} />
                </div>
            </BrowserRouter>
        </div>
    );
}

export default App;
